import React from "react";

const Logo = () => (
    <defs>
      <style>{".a{fill:url(#a);}"}</style>
      <pattern
        id="a"
        preserveAspectRatio="xMidYMid slice"
        width="100%"
        height="100%"
        viewBox="0 0 1534 931"
      >
        <image width={1534} height={931} xlinkHref="logo.png" /> 
      </pattern>
    </defs>
);

export default Logo;
